import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-67347ce98ee81",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/barbosa/docs/peef/docs/README.md").then(comp => {
        Vue.component("v-67347ce98ee81", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-69d07445054f8",
    path: "/guide/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/barbosa/docs/peef/docs/guide/README.md").then(comp => {
        Vue.component("v-69d07445054f8", comp.default)
        next()
      })
    }
  },
  {
    path: "/guide/index.html",
    redirect: "/guide/"
  },
  {
    name: "v-52301ca720cfb",
    path: "/guide/test.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/barbosa/docs/peef/docs/guide/test.md").then(comp => {
        Vue.component("v-52301ca720cfb", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
